initialState = false;


const loggedReducer = (state = initialState, action) => { //change initial state back to false
    switch(action.type){
        case 'LOG_IN':
            return  true;
        case 'LOG_OUT':
            return {...state}, false;
    }
}

export default loggedReducer;
